import { Page, Layout } from "@shopify/polaris";

class BundleLink extends React.Component {
  state = {};
  render() {
    return (
      <Page>
        <Layout>
          <h1>Bundle Link</h1>
        </Layout>
      </Page>
    );
  }
}

export default BundleLink;
